(8,	6,	0,	'<p>I&#39;m going to add some too:</p><p><strong>3. Go to line</strong></p><p>After you&rsquo;ve opened a&nbsp;file in the Sources tab, DevTools allows you to easily jump to any line in it. To do so press Ctrl + G for Windows and Linux, (or Cmd + L for Mac), and type in your line number.</p><p><strong>4. Color Picker</strong></p><p>When selecting a color in the Styles editor you can click on the color preview&nbsp;and a picker will pop up. While the color picker is opened, if you hover over your page, your mouse pointer will transform into a magnifying glass for selecting colors with pixel accuracy.</p>',	1,	'2015-05-10 14:13:35'),
(9,	6,	0,	'<p>Here are some from me:</p><p><strong>5. Force element state</strong></p><p>DevTools has a feature that simulates&nbsp;CSS&nbsp;states like&nbsp;:hover&nbsp;and&nbsp;:focus&nbsp;on elements, making it easy to style them. It is available from the CSS editor.</p><p>&nbsp;</p><p><strong>6. Visualize the shadow DOM</strong></p><p>Web browsers construct things like textboxes, buttons and inputs out of other basic elements which are normally hidden from view. However, you can go to Settings -&gt; General and toggle&nbsp;<strong>Show user agent shadow DOM</strong>, which&nbsp;will display them in the elements tab. You can even style them individually, which gives you a great deal of control.</p>',	5,	'2015-05-10 14:14:23');

