INSERT INTO `topics` (`id`, `title`, `content`, `author_id`, `views`, `rating`, `answers`, `category_id`, `date`) VALUES
(3,	'Aston Martin DB9',	'<p><strong>What is it?</strong></p><p>Purest class, and doubly delicious to those in the know for being the car that kick-started Aston&#39;s renaissance. A brawny,&nbsp;<em>sexy&nbsp;</em>GT with a V12 under the bonnet, now refreshed for 2013.</p><p><strong>Driving</strong></p><p>The DB9 was conceived specifically as a GT and you should expect it to handle as such; there&#39;s a big V12 hanging out there at the front, so it shades to understeer when you really push. You can cure the tendency with a stab of throttle, but that&#39;s not really the point. A bit firm if we&#39;re being pedantic. Volante drop-top a tad wobbly around the edges.</p><p>Power&#39;s up from 470bhp to 510bhp, torque rises to 457lb ft and the 0-62mph dash now takes 4.6 seconds. The six-speed, paddle-override ZF auto is also supreme at making those shifts work for you and if that isn&#39;t enough, it sounds like it&#39;s doing 200mph when you start it up (even if it tops out at 183mph). Is it good? Yes. Very.</p>',	1,	24,	1,	2,	13,	'2015-05-10 14:07:36'),
(5,	'Jack Ryan: Shadow Recruit',	'<p>Jack Ryan, as a young covert CIA analyst, uncovers a Russian plot to crash the U.S. economy with a terrorist attack.</p><p><strong>Admin edit...</strong></p>',	5,	16,	1,	2,	10,	'2015-05-10 13:59:41'),
(6,	'2 Must-Know Chrome DevTools Tips and Tricks',	'<p>Google Chrome is the most popular web browser used by web developers today. With a quick six week release cycle and a powerful set of ever expanding developer features turned the browser into a must have tool. Most of you are probably familiar with many of its features like live-editing CSS, using the console and the debugger. In this&nbsp;article we&rsquo;re going to&nbsp;share with you 15 cool tips and tricks that will improve your workflow even more.</p><p>&nbsp;</p><p><strong>1.&nbsp;Quick file switching</strong></p><p>If you&rsquo;ve used Sublime Text, you probably can&rsquo;t live without its &ldquo;Go to anything&rdquo; overlay. You will be happy to hear that dev tools has it too. Press Ctrl + P (Cmd + P on Mac) when DevTools is opened,&nbsp;to quickly search for, and open&nbsp;any&nbsp;file in your project.</p><p><strong>2. Search within source code</strong></p><p>But what about if you wish to search within source code? To search in all files loaded on the page for a specific string, hit Ctrl + Shift + F (Cmd + Opt&nbsp;+ F). This method of searching supports Regular expressions as well.</p>',	7,	14,	1,	2,	14,	'2015-05-10 15:01:12'),
(7,	'Making Your First Google Chrome Extension',	'<p>The Google Chrome web browser is slowly growing in popularity. This is no surprise, as it is a great browser, and is backed by no other than Google. It also provides great tools for web developers and I find myself using it more and more (actually Firebug is the only thing keeping me from crossing to the other side).</p><p>With the introduction of&nbsp;<a target=\"_blank\" href=\"https://chrome.google.com/extensions\">extensions</a>, Google Chrome became even more agile and powerful.</p><p>In this tutorial, we are going to create a simple extension, which puts a small icon next to Chrome&rsquo;s address bar, and, when clicked, will fetch Tutorialzine&rsquo;s RSS feed and display a fancy preview of our latest tutorials.</p><p>First a few words about extensions.</p>',	5,	1,	0,	0,	14,	'2015-05-10 14:15:40'),
(8,	'Official: the McLaren P1 GTR\'s interior',	'<p><em>McLaren reveals first ever pics of 986bhp monster on track and its insides. Afraid? You should be</em></p><p>The new&nbsp;<a href=\"http://www.topgear.com/uk/tags/McLaren\">McLaren</a>&nbsp;P1 GTR will feature a steering wheel inspired by the one on Lewis Hamilton&#39;s championship-winning 2008 MP4-23 Formula One car.</p><p>Proof enough then, that McLaren is quite serious about the business of making the P1 GTR the best driver&#39;s car in the world on track. We can reveal the first official pictures of its interior today, and it&#39;s unsurprisingly quite spartan. And features a steering wheel that&#39;s now six years old.<br /><br />First off, you should know that the P1 GTR is an even harder, more powerful version of the already quite powerful &lsquo;standard&#39; P1. It&#39;s combination of 3.8-litre twin-turbo V8 and electric motor now produces a whopping 986bhp, 83bhp more than the ordinary P1.</p>',	8,	2,	0,	0,	13,	'2015-05-10 14:26:20');

